import styled from 'styled-components'


export const Button = styled.button`
  border-radius: 50px;
  background-color:#01bf71 ;
  padding:10px 22px;
  color:#010606;
  font-size:16px;
  outline:none;
  border:none;
  cursor: pointer;
  transition: all 0.2s ease-in-out;
  text-decoration: none;

  &:hover  {
    transition: all 0.2s ease-in-out;
    background-color: white;
    color:#010606;

`;
